import React from 'react';
import './App.css';
import mapAgeCleaner from 'map-age-cleaner';


const sudoku = [];




class Field extends React.Component{

  render(){

    return(
      <div class="field">

        {this.props.children}

      </div>
    )
  }
}


class Square extends React.Component{

  render(){

    return(
      <div class="square">

        <Field/>
        <Field/>
        <Field/>
        <Field/>
        <Field/>
        <Field/>
        <Field/>
        <Field/>
        <Field/>

      </div>
    )
  }
}


class Sudoku extends React.Component{

  render(){

    return(
      <div class="sudoku">

        <Square/>
        <Square/>
        <Square/>
        <Square/>
        <Square/>
        <Square/>
        <Square/>
        <Square/>
        <Square/>

      </div>
    )

  }
}



function App() {
  return (
    <div className="App">

      <Sudoku/>

    </div>
  );
}

export default App;
